/*
Given an array of integers arr, you are initially positioned at the first index of the array.

In one step you can jump from index i to index:

i + 1 where: i + 1 < arr.length.
i - 1 where: i - 1 >= 0.
j where: arr[i] == arr[j] and i != j.
Return the minimum number of steps to reach the last index of the array.

Notice that you can not jump outside of the array at any time.
*/
#include <iostream>
#include <vector>
#include <unordered_map>
#include <queue>
using namespace std;

class Solution {
public:
    int minJumps(vector<int>& arr) {
        if(arr.size()==1) return 0;
        unordered_map<int, vector<int>> m;
        for(int i=0;i<arr.size();i++){
            m[arr[i]].push_back(i);
        }
        int res = 0;
        queue<int> q;
        q.push(0);
        vector<bool> seen(arr.size(), false);
        seen[0] = true;
        while(!q.empty()){
            int size = q.size();
            res++;
            for(int i=0;i<size;i++){
                int node = q.front();
                q.pop();
                for(int neighbor : m[arr[node]]){
                    if(neighbor!=node && !seen[neighbor]){
                        if(neighbor==arr.size()-1) return res;
                        seen[neighbor] = true;
                        q.push(neighbor);
                    }
                }
                m[arr[node]].clear(); //this is important
                if(node-1>=0 && !seen[node-1]){
                    seen[node-1]=true;
                    q.push(node-1);
                }
                if(node+1<arr.size() && !seen[node+1]){
                    if(node+1==arr.size()-1) return res;
                    seen[node+1] = true;
                    q.push(node+1);
                }
            }
        }
        return res;
    }
};

